// Watch.js
import React, { useState, useEffect } from 'react';
import Navbar from './Navbar';
import './Watch.css';

const Watch = () => {
  const [videos, setVideos] = useState([]);

  useEffect(() => {
    // Fetch video/reel data from an API or use mock data
    const mockData = [
      { id: 1, type: 'youtube', url: 'https://youtu.be/2g-47242sqY?feature=shared' },
      { id: 2, type: 'instagram', url: 'https://www.instagram.com/p/REEL_ID_2/embed' },
      { id: 3, type: 'youtube', url: 'https://youtu.be/vbZscfMZFLM?feature=shared' },
      { id: 4, type: 'youtube', url: 'https://youtu.be/sRYM70VuLcg?feature=shared' },
      { id: 5, type: 'instagram', url: 'https://www.instagram.com/p/REEL_ID_5/embed' },
      { id: 6, type: 'youtube', url: 'https://www.youtube.com/embed/VIDEO_ID_6' },
      { id: 7, type: 'instagram', url: 'https://www.instagram.com/p/REEL_ID_7/embed' },
      { id: 8, type: 'youtube', url: 'https://www.youtube.com/embed/VIDEO_ID_8' },
      { id: 9, type: 'instagram', url: 'https://www.instagram.com/p/REEL_ID_9/embed' },
      { id: 10, type: 'youtube', url: 'https://www.youtube.com/embed/VIDEO_ID_10' },
    ];

    setVideos(mockData);
  }, []);

  return (
    <div className="watch-container">
      <Navbar />
      <div className="watch-grids">
        <div className="watch-grid grid-1">
          {videos.slice(0, 4).map((video) => (
            <div key={video.id} className="watch-item">
              {video.type === 'youtube' ? (
                <iframe
                  title={`YouTube Video ${video.id}`}
                  src={video.url}
                  frameBorder="0"
                  allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture"
                  allowFullScreen
                />
              ) : (
                <iframe
                  title={`Instagram Reel ${video.id}`}
                  src={video.url}
                  frameBorder="0"
                  allowFullScreen
                />
              )}
            </div>
          ))}
        </div>
        <div className="watch-grid grid-2">
          {videos.slice(4, 8).map((video) => (
            <div key={video.id} className="watch-item">
              {video.type === 'youtube' ? (
                <iframe
                  title={`YouTube Video ${video.id}`}
                  src={video.url}
                  frameBorder="0"
                  allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture"
                  allowFullScreen
                />
              ) : (
                <iframe
                  title={`Instagram Reel ${video.id}`}
                  src={video.url}
                  frameBorder="0"
                  allowFullScreen
                />
              )}
            </div>
          ))}
        </div>
        <div className="watch-grid grid-3">
          {videos.slice(8, 10).map((video) => (
            <div key={video.id} className="watch-item">
              {video.type === 'youtube' ? (
                <iframe
                  title={`YouTube Video ${video.id}`}
                  src={video.url}
                  frameBorder="0"
                  allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture"
                  allowFullScreen
                />
              ) : (
                <iframe
                  title={`Instagram Reel ${video.id}`}
                  src={video.url}
                  frameBorder="0"
                  allowFullScreen
                />
              )}
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Watch;
